import styled from 'styled-components';

const Container = styled.div`
	margin-top: 10px;
	background: linear-gradient(#393939, #424242);
	width: 100%;
	border-radius: 10px;
	border-style: groove;
	border-width: 1px;
	border-color: #171717;
	height: 35px;
	font-family: Arial;
	display: flex;
	justify-content: center;
	align-items: center;
	padding: 0px 20px 0px 20px;
`;

export { Container };
